'''
Sherlock considers a string to be valid if all characters of the string appear the same number of times. 

It is also valid if he can remove just ONE character at ONE index in the string, and the remaining characters will occur the same number of times. 

Given a string , determine if it is valid. If so, return YES, otherwise return NO

isValid function will take in a string as a parameter
'''

from collections import Counter

def isValid(s):
    if len(s) == 1:
        return "YES"
    elif len(s) > 1:
        # get number of occurrences for each character and store them in a dictionary
        char_count_dict = Counter(s)
        print(char_count_dict)

        # find the highest and lowest occurrence
        highest = max(char_count_dict.values())
        lowest = min(char_count_dict.values())

        # get number of characters with the lowest and highest occurrence
        num_chars_lowest = Counter(char_count_dict.values())[lowest]
        num_chars_highest = Counter(char_count_dict.values())[highest]

        # e.g. in {'a': 4, 'b': 2, 'c': 2}
        # Lowest occurrence: 2
        # Highest occurrence: 4
        # Num_chars_lowest: 2 --> b and c
        # Num_chars_highest: 1 --> only a   
        print("Lowest occurrence: {}".format(lowest))
        print("Highest occurrence: {}".format(highest))
        print("Num_chars_lowest: {}".format(num_chars_lowest))
        print("Num_chars_highest: {}".format(num_chars_highest))

        if highest - lowest == 1:
            if num_chars_lowest > num_chars_highest:
                if num_chars_highest > 1:
                    return "NO"
                else:
                    return "YES"
            elif num_chars_lowest < num_chars_highest:
                if num_chars_lowest > 1:
                    return "NO"
                else:
                    return "YES"
            # if there is more than 1 character that has the lowest occurrence, the string will be invalid since we can't remove more than 2 characters
            elif num_chars_lowest == num_chars_highest:
                return "NO"
        
        # if each character occurs the same number of times
        elif highest == lowest:
            return "YES"

        # if the lowest occurrence is 1 it means that a certain character has appeared ONCE
        # also check if the number of chars with the highest occurrence is more than the number of chars with the lowest occurrence
        # if the above conditions are fulfilled, this means that a certain character has appeared only ONCE and can be removed to make the string valid     
        elif lowest == 1 and num_chars_highest > num_chars_lowest:
            return "YES"

        else:
            return "NO"

if __name__ == "__main__":
    print(isValid("aaaabbcc"))
    print(isValid(""))